import React from "react";
import IntlMessages from "../../../../../util/IntlMessages";
import CardBox from "../../../../../components/CardBox/index";
import Can from "../../../../../can";
import { RoleContext } from "../../../../../Context";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import RemoveSharpIcon from "@material-ui/icons/RemoveSharp";
import GetAppIcon from "@material-ui/icons/GetApp";
import { connect } from "react-redux";
import {
  KeyboardDatePicker,
  MuiPickersUtilsProvider,
} from "@material-ui/pickers";
import DateFnsUtils from "@date-io/moment";
import InputLabel from "@material-ui/core/InputLabel";
import Select from "react-select";
import AddBox from "@material-ui/icons/AddBox";
import Typography from "@material-ui/core/Typography";
import WcIcon from "@material-ui/icons/Wc";
import { Radio } from "@material-ui/core";
import CheckCircleIcon from "@material-ui/icons/CheckCircle";
import RadioButtonUncheckedIcon from "@material-ui/icons/RadioButtonUnchecked";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import DeleteOutlineIcon from "@material-ui/icons/DeleteOutline";
import PrintIcon from "@material-ui/icons/Print";
import PictureAsPdfIcon from "@material-ui/icons/PictureAsPdf";
import { getAllRole } from "../../../../../actions/usersAction";
import RadioGroup from "@material-ui/core/RadioGroup";
import FormControl from "@material-ui/core/FormControl";
import PhotoIcon from "@material-ui/icons/Photo";
// {
//   name,
// surname,
// gender,
// dateOfBirth,
// address,
// phone,
// cin,
// zipCode,
// nameAr,
// surnameAr,
// creationDate,
// email,
// roleId,
// establishmentId,
// dateOfStartContract,
// dateOfEndContract,
// assignClassSubject
// classId,
// levelId,
// sectionId,
// schoolYearId,

// }

// out put user  {
// userData,
// userProfile,
// profileEtab,
// student/parent/profData
// }
// userCIN:'',
// userID:'',
// userMail:'',
// userAdress:"",
// userCountry:"",
// userZipCode:"",
// userPhoto:"",
class AddSchoolSession extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      papiers: [
        "Facture de payeement",
        "Attestation de présence",
        "Règlement intérieur",
      ],
    };
    this.handleChange = this.handleChange.bind(this);
  }
  handleChange = (name) => (event) => {
    this.setState({ [name]: event.target.value });
  };
  render() {
    console.log(this.props.courseAssignment,'courseAssignment');
    const { values } = this.props;
    return (
      <div class="col-lg-12 col-md-12 col-sm-12 d-flex flex-wrap align-items-start">
        <div class="col-lg-12 col-md-12 col-sm-12 d-flex flex-row flex-wrap  justify-content-between align-items-center">
          <div class="d-flex flex-row ">
            <Fab
              size="small"
              color="primary"
              aria-label="Add"
              onClick={this.props.openAddModal}
            >
              {this.props.values.isOpen ? <RemoveSharpIcon /> : <AddIcon />}
            </Fab>
            &nbsp;&nbsp;&nbsp;
            <Typography
              variant="h6"
              style={{
                color: "black",
                fontWeight: "blod",
                fontFamily: "Roboto",
                fontSize: "25px",
              }}
            >
              <IntlMessages id="add.new.user" />
            </Typography>
          </div>
          &nbsp;&nbsp;&nbsp;
          <div class="d-flex flex-row">
            <Fab
              size="small"
              color="secondary"
              aria-label="Add"
              // onClick={this.props.openAddModal}
            >
              <GetAppIcon />
            </Fab>
            &nbsp;&nbsp;&nbsp;
            <Typography
              variant="h6"
              style={{
                color: "black",
                fontWeight: "blod",
                fontFamily: "Roboto",
                fontSize: "25px",
              }}
            >
              <IntlMessages id="upload.file.user" />
            </Typography>
          </div>
          &nbsp;&nbsp;&nbsp;
          <div class="d-flex flex-row ">
          <Fab
            size="small"
             aria-label="Add"
            style={{ backgroundColor: "#ffbb33", color:"#ffffff" }}
             onClick={this.props.openArchive}

          >
            <DeleteOutlineIcon />
          </Fab>
            &nbsp;&nbsp;&nbsp;
            <Typography
              variant="h6"
              style={{
                color: "black",
                fontWeight: "blod",
                fontFamily: "Roboto",
                fontSize: "25px",
              }}
            >
              <IntlMessages id="service.button.archives" />
            </Typography>
          </div>
          <div class="d-flex flex-row justify-content-between">
            &nbsp;&nbsp;&nbsp;
            <PrintIcon
              style={{
                fontSize: "35",
              }}
              color="inherit"
            />
            &nbsp;&nbsp;&nbsp;
            <PictureAsPdfIcon
              style={{
                fontSize: "35",
              }}
              color="inherit"
            />
          </div>
        </div>

        <form
          class="d-flex  flex-wrap col-lg-12 col-md-12 col-sm-12 p-4"
          autoComplete="off"
          onSubmit={this.props.handleSubmit}
        >
          {this.props.values.isOpen ? (
            <>
              <div class=" d-flex col-lg-12 col-md-12 col-sm-12 flex-row flex-wrap justify-content-around align-items-center">
                <div className="col-md-6 col-lg-2 col-sm-12 p-0">
                  <InputLabel
                    htmlFor="nomSelect"
                    style={{
                      fontFamily: "Roboto",
                      fontSize: "18px",
                    }}
                    required
                  >
                    {<IntlMessages id="role.user" />}
                  </InputLabel>
                  <Select
                    required
                    options={this.props.values.listRoles}
                    onChange={this.props.handleChangeRole}
                    id="role"
                    name="role"
                    styles={{
                      control: (base) => ({
                        ...base,
                        "&:hover": { borderColor: "gray" }, // border style on hover
                        border: "1px solid lightgray", // default border color
                        boxShadow: "none", // no box-shadow
                        borderTopStyle: "none",
                        borderRightStyle: "none",
                        borderLeftStyle: "none",
                        borderRadius: " none",
                      }),
                    }}
                  />{" "}
                </div>
                <div className="col-md-6 col-lg-2 col-sm-12 p-0">
                  <InputLabel
                    htmlFor="nomSelect"
                    style={{
                      fontFamily: "Roboto",
                      fontSize: "18px",
                    }}
                    required
                  >
                    {<IntlMessages id="school.year.user" />}
                  </InputLabel>
                  <Select
                    options={this.props.values.listSchoolYears}
                    onChange={this.props.handleChangeSchoolYear}
                    id="role"
                    name="role"
                    styles={{
                      control: (base) => ({
                        ...base,
                        "&:hover": { borderColor: "gray" }, // border style on hover
                        border: "1px solid lightgray", // default border color
                        boxShadow: "none", // no box-shadow
                        borderTopStyle: "none",
                        borderRightStyle: "none",
                        borderLeftStyle: "none",
                        borderRadius: " none",
                      }),
                    }}
                  />{" "}
                </div>
                {this.props.userProfile.role_id === 1 ? (
                  <>
                    <div className="col-md-6 col-lg-2 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                        required
                      >
                        {<IntlMessages id="user.establishment" />}
                      </InputLabel>
                      <Select
                        // options={this.props.values.listSchoolYears}
                        // onChange={this.props.handleChangeSchoolYear}
                        id="role"
                        name="role"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                  </>
                ) : (
                  ""
                )}
                {this.props.values.roleName === "Student" ? (
                  <>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                      >
                        {<IntlMessages id="parent.couplage.user" />}
                      </InputLabel>
                      <Select
                        value={{
                          // label: this.props.informationsAdd.schoolSessionName,
                          value: 1,
                        }}
                        // options={this.props.informationsAdd.schoolSessionName}
                        id="role"
                        name="role"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                        required
                      >
                        {<IntlMessages id="classe.couplage.user" />}
                      </InputLabel>
                      <Select
                        value={{
                          // label: this.props.informationsAdd.schoolSessionName,
                          value: 1,
                        }}
                        // options={this.props.informationsAdd.schoolSessionName}
                        id="nomSelect"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                  </>
                ) : (
                  ""
                )}
                {this.props.values.roleName === "Professor" ? (
                  <>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                      >
                        {<IntlMessages id="prof.couplage.class" />}
                      </InputLabel>
                      <Select
                        value={{
                          // label: this.props.informationsAdd.schoolSessionName,
                          value: 1,
                        }}
                        // options={this.props.informationsAdd.schoolSessionName}
                        id="nomSelect"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                        required
                      >
                        {<IntlMessages id="prof.couplage.subjects" />}
                      </InputLabel>
                      <Select
                        value={{
                          // label: this.props.informationsAdd.schoolSessionName,
                          value: 1,
                        }}
                        // options={this.props.informationsAdd.schoolSessionName}
                        id="nomSelect"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                  </>
                ) : (
                  ""
                )}
                {this.props.values.roleName === "Parent" ? (
                  <>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                      >
                        {<IntlMessages id="parent.couplage.student" />}
                      </InputLabel>
                      <Select
                        value={{
                          // label: this.props.informationsAdd.schoolSessionName,
                          value: 1,
                        }}
                        // options={this.props.informationsAdd.schoolSessionName}
                        id="nomSelect"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                  </>
                ) : (
                  ""
                )}
                <hr
                  style={{
                    width: "100%",
                    margin: "auto",
                    marginTop: "40px",
                    marginBottom: "10px",
                    border: "1px dashed #979A9A",
                    paddingLeft: "-100%",
                  }}
                />
              </div>

              <div class="d-flex col-lg-12 col-md-12 col-sm-12 flex-row flex-wrap justify-content-around align-items-center pt-3">
                <div className="col-md-6 col-lg-2 col-sm-12 p-1">
                  <InputLabel
                    style={{
                      fontFamily: "Roboto",
                      fontSize: "18px",
                      marginTop: "-2%",
                    }}
                    required
                  >
                    {<IntlMessages id="user.name" />}
                  </InputLabel>
                  <TextField
                    required
                    // error={values.nameError}
                    id="userName"
                    name="userName"
                    value={values.userName || ""}
                    onChange={this.props.handleChange("userName")}
                    style={{
                      marginTop: "3%",
                    }}
                    fullWidth
                    SelectProps={{
                      native: true,
                    }}
                  />
                  {/* <FormHelperText
                    error={values.nameError}
                    >
                      {values.nameError ? 'Nom de support de cours déja existe' : ''}
                    </FormHelperText> */}
                </div>
                <div className="col-md-6 col-lg-2 col-sm-12 p-1">
                  <InputLabel
                    style={{
                      fontFamily: "Roboto",
                      fontSize: "18px",
                      marginTop: "-2%",
                    }}
                    required
                  >
                    {<IntlMessages id="user.last.name" />}
                  </InputLabel>
                  <TextField
                    required
                    // error={values.nameError}
                    id="userLastName"
                    name="userLastName"
                    value={values.userLastName || ""}
                    onChange={this.props.handleChange("userLastName")}
                    style={{
                      marginTop: "3%",
                    }}
                    fullWidth
                    SelectProps={{
                      native: true,
                    }}
                  />
                  {/* <FormHelperText
                    error={values.nameError}
                    >
                      {values.nameError ? 'Nom de support de cours déja existe' : ''}
                    </FormHelperText> */}
                </div>
                <div className="col-md-6 col-lg-2 col-sm-12 p-0 d-flex justify-content-center">
                  <div className="col-md-2 p-1 d-flex justify-content-center align-items-end ">
                    <Radio
                      checked={values.userGender == "Male"}
                      onChange={this.props.handleChange("userGender")}
                      value="Male"
                      color="primary"
                      name="radio-button-demo"
                      inputProps={{ "aria-label": "D" }}
                    />
                    <WcIcon color="primary" style={{ fontSize: 60 }} />
                    <Radio
                      checked={values.userGender == "Female"}
                      onChange={this.props.handleChange("userGender")}
                      value="Female"
                      color="primary"
                      name="radio-button-demo"
                      inputProps={{ "aria-label": "D" }}
                    />
                  </div>
                </div>
                <div className="col-md-6 col-lg-2 col-sm-12 p-2">
                  <MuiPickersUtilsProvider utils={DateFnsUtils}>
                    <KeyboardDatePicker
                      label={
                        <InputLabel
                          style={{
                            backgroundColor: "white",
                            fontFamily: "Roboto",
                            fontSize: "30px",
                            marginTop: "-16px",
                            width: "300px",
                          }}
                          required
                        >
                          {<IntlMessages id="user.birthday.date" />}
                        </InputLabel>
                      }
                      clearable
                      fullWidth
                      id="birthdayDate"
                      name="birthdayDate"
                      value={values.birthdayDate}
                      onChange={this.props.handleChangeBirthdayDate}
                      format="DD-MM-YYYY"
                      autoOk
                      style={{
                        marginTop: "4px",
                      }}
                      minDate={new Date()}
                    />
                  </MuiPickersUtilsProvider>
                </div>
                <div className="col-md-6 col-lg-2 col-sm-12 p-2">
                  <InputLabel
                    style={{
                      fontFamily: "Roboto",
                      fontSize: "18px",
                      marginTop: "-16px",
                      width: "300px",
                    }}
                  >
                    {<IntlMessages id="user.birthday.place" />}
                  </InputLabel>
                  <TextField
                    required
                    // error={values.nameError}
                    id="birthdayPlace"
                    name="birthdayPlace"
                    value={values.birthdayPlace || ""}
                    onChange={this.props.handleChange("birthdayPlace")}
                    style={{
                      marginTop: "3%",
                    }}
